import React, { useState } from 'react';
import {
  Container,
  TextField,
  Button,
  Typography,
  Paper,
  Box,
  CircularProgress,
  Alert,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Divider,
} from '@mui/material';
import {
  Security,
  Warning,
  CheckCircle,
  Error,
  Speed,
  Link,
} from '@mui/icons-material';
import axios from 'axios';

function App() {
  const [url, setUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');

  const analyzeUrl = async () => {
    if (!url) {
      setError('Please enter a URL');
      return;
    }

    setLoading(true);
    setError('');
    setResult(null);

    try {
      const response = await axios({
        method: 'post',
        url: 'http://localhost:5000/api/analyze',
        data: { url },
        headers: {
          'Content-Type': 'application/json',
        }
      });
      setResult(response.data);
    } catch (err) {
      console.error('Error details:', err);
      setError(err.response?.data?.error || 'An error occurred while analyzing the URL');
    } finally {
      setLoading(false);
    }
  };

  const getThreatColor = (level) => {
    switch (level) {
      case 'HIGH':
        return 'error';
      case 'MEDIUM':
        return 'warning';
      case 'LOW':
        return 'success';
      default:
        return 'info';
    }
  };

  return (
    <Container maxWidth="md" sx={{ py: 4 }}>
      <Typography variant="h3" component="h1" gutterBottom align="center">
        Cyber Threat Detection System
      </Typography>

      <Paper elevation={3} sx={{ p: 3, mb: 3 }}>
        <Box sx={{ display: 'flex', gap: 2, mb: 2 }}>
          <TextField
            fullWidth
            label="Enter URL to analyze"
            variant="outlined"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="https://example.com"
          />
          <Button
            variant="contained"
            color="primary"
            onClick={analyzeUrl}
            disabled={loading}
            sx={{ minWidth: 120 }}
          >
            {loading ? <CircularProgress size={24} /> : 'Analyze'}
          </Button>
        </Box>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        {result && (
          <Box sx={{ mt: 3 }}>
            <Typography variant="h5" gutterBottom>
              Real-time Analysis Results
            </Typography>

            <List>
              <ListItem>
                <ListItemIcon>
                  <Link />
                </ListItemIcon>
                <ListItemText
                  primary="Domain"
                  secondary={result.domain}
                />
              </ListItem>

              <Divider />

              <ListItem>
                <ListItemIcon>
                  <Security />
                </ListItemIcon>
                <ListItemText
                  primary="SSL Security"
                  secondary={
                    <Alert
                      severity={result.ssl_secure ? 'success' : 'error'}
                      sx={{ mt: 1 }}
                    >
                      {result.ssl_secure ? 'Secure' : 'Not Secure'}
                    </Alert>
                  }
                />
              </ListItem>

              <Divider />

              <ListItem>
                <ListItemIcon>
                  <Warning />
                </ListItemIcon>
                <ListItemText
                  primary="Threat Level"
                  secondary={
                    <>
                      <Alert
                        severity={getThreatColor(result.threat_level)}
                        sx={{ mt: 1, mb: 1 }}
                      >
                        {result.threat_level}
                      </Alert>
                      {result.threat_reasons && result.threat_reasons.length > 0 && (
                        <List dense>
                          {result.threat_reasons.map((reason, index) => (
                            <ListItem key={index}>
                              <ListItemText primary={reason} />
                            </ListItem>
                          ))}
                        </List>
                      )}
                    </>
                  }
                />
              </ListItem>

              <Divider />

              {result.domain_age_days !== null && (
                <>
                  <ListItem>
                    <ListItemIcon>
                      <Warning />
                    </ListItemIcon>
                    <ListItemText
                      primary="Domain Age"
                      secondary={`${result.domain_age_days} days old`}
                    />
                  </ListItem>
                  <Divider />
                </>
              )}

              {result.security_headers && (
                <>
                  <ListItem>
                    <ListItemIcon>
                      <Security />
                    </ListItemIcon>
                    <ListItemText
                      primary="Security Headers"
                      secondary={
                        <List dense>
                          {Object.entries(result.security_headers).map(([header, value]) => (
                            <ListItem key={header}>
                              <ListItemText
                                primary={header}
                                secondary={
                                  <Alert
                                    severity={value === 'Not Set' ? 'warning' : 'success'}
                                    sx={{ mt: 1 }}
                                  >
                                    {value}
                                  </Alert>
                                }
                              />
                            </ListItem>
                          ))}
                        </List>
                      }
                    />
                  </ListItem>
                  <Divider />
                </>
              )}

              {result.open_ports && result.open_ports.length > 0 && (
                <>
                  <ListItem>
                    <ListItemIcon>
                      <Error />
                    </ListItemIcon>
                    <ListItemText
                      primary="Open Ports"
                      secondary={
                        <Alert severity="warning" sx={{ mt: 1 }}>
                          {result.open_ports.join(', ')}
                        </Alert>
                      }
                    />
                  </ListItem>
                  <Divider />
                </>
              )}

              {result.suspicious_patterns.length > 0 && (
                <>
                  <ListItem>
                    <ListItemIcon>
                      <Error />
                    </ListItemIcon>
                    <ListItemText
                      primary="Suspicious Patterns Detected"
                      secondary={
                        <List>
                          {result.suspicious_patterns.map((pattern, index) => (
                            <ListItem key={index}>
                              <ListItemText primary={pattern} />
                            </ListItem>
                          ))}
                        </List>
                      }
                    />
                  </ListItem>
                  <Divider />
                </>
              )}

              <ListItem>
                <ListItemIcon>
                  <Speed />
                </ListItemIcon>
                <ListItemText
                  primary="Traffic Analysis"
                  secondary={
                    result.traffic_analysis.success
                      ? result.traffic_analysis.output
                      : 'Traffic analysis failed'
                  }
                />
              </ListItem>

              <Divider />

              <ListItem>
                <ListItemIcon>
                  <CheckCircle />
                </ListItemIcon>
                <ListItemText
                  primary="Recommendations"
                  secondary={
                    <List>
                      {result.recommendations.map((rec, index) => (
                        <ListItem key={index}>
                          <ListItemText primary={rec} />
                        </ListItem>
                      ))}
                    </List>
                  }
                />
              </ListItem>
            </List>
          </Box>
        )}
      </Paper>
    </Container>
  );
}

export default App;
